import React from 'react';
import {Board} from './Board'
import {Moves} from './Moves'

export class Game extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="game">
                <div className="game-board">
                    <Board />
                </div>
                <div className="game-info">
                    <div>{/* Game Status */}</div>
                    <Moves />
                </div>
            </div>
        );
    }
}
